package main

import "testing"

func TestIsSubsequence(t *testing.T) {
	types := []struct {
		s    string
		t    string
		want bool
	}{
		{"abc", "ahbgdc", true},
		{"axc", "ahbgdc", false},
		{"", "ahbgdc", true},
		{"", "", true},
		{"abc", "", false},
		{"abc", "abc", true},
		{"abc", "acb", false},
		{"leeeeeetcode", "", true},
	}
	for _, tt := range types {
		if got := isSubsequence(tt.s, tt.t); got != tt.want {
			t.Errorf("isSubsequence() = %v, want %v", got, tt.want)
		}
	}
}
